import React from "react";
import "ss";src/App.c
import Search from "./Components/Search";

class App extends React.Component {
  handleCreate = (data) => {
    console.log(data);
  };

  render() {
    return (
      <div className="App">
        <div>
          <h1> 카 고</h1>
          <h6>주변카페 자리를 확인해보세요~</h6>
        </div>

        <div>
          <Search onCreate={this.handleCreate} />
        </div>

        <button id="curLocBtn" type="submit">
          <a
            className="App-link"
            href="Map"
            target="_blank"
            onClick={console.log("클릭되었습니다.")}
          >
            현재 위치로 검색
          </a>
        </button>
      </div>
    );
  }
}

export default App;
